  var key = strKey.split('-');
  var searched = key.reduce(function (acc, item) {
    if (accum[acc]) {
      return acc;
    }

    acc = acc.replace(item + "-", '');
    return acc;
  }, strKey);
  return accum[searched] ? searched : false;
};
